'use strict';

const {
    assertClass,
    GLOBAL_TIMEOUT
} = require('./propertiesCommon');

describe('Rewrite_Profile', function () {
    this.timeout(GLOBAL_TIMEOUT);

    function assertRewriteProfileClass(properties) {
        return assertClass('Rewrite_Profile', properties);
    }

    it('All properties', function () {
        const properties = [
            {
                name: 'bypassList',
                inputValue: [
                    undefined,
                    [
                        'https://www.google.com', 'http://www.a.uri.com'
                    ],
                    undefined
                ],
                expectedValue: [
                    [],
                    ['https://www.google.com', 'http://www.a.uri.com'],
                    []
                ]
            },
            {
                name: 'clientCachingType',
                inputValue: [undefined, 'no-cache', undefined],
                expectedValue: ['cache-css-js', 'no-cache', 'cache-css-js']
            },
            {
                name: 'javaCaFile',
                inputValue: [
                    undefined,
                    {
                        bigip: '/Common/default.crt'
                    },
                    undefined
                ],
                expectedValue: [
                    'ca-bundle.crt',
                    'default.crt',
                    'ca-bundle.crt'
                ],
                extractFunction: (o) => o.javaCaFile.name
            },
            {
                name: 'certificate',
                inputValue: [
                    undefined,
                    'cert_and_key_with_bundle',
                    undefined
                ],
                expectedValue: [
                    'default.crt',
                    'cert_and_key_with_bundle.crt',
                    'default.crt'
                ],
                referenceObjects: {
                    cert_and_key_with_bundle: {
                        class: 'Certificate',
                        certificate: '-----BEGIN CERTIFICATE-----\\n-----END CERTIFICATE-----',
                        privateKey: '-----BEGIN RSA PRIVATE KEY-----\\n-----END RSA PRIVATE KEY-----',
                        chainCA: '-----BEGIN CERTIFICATE-----\\n-----END CERTIFICATE-----'
                    }
                },
                extractFunction: (o) => o.javaSigner.name
            },
            {
                name: 'javaSignKeyPassphrase',
                inputValue: [
                    undefined,
                    {
                        ciphertext: 'ZjVmNQ==',
                        protected: 'eyJhbGciOiJkaXIiLCJlbmMiOiJub25lIn0',
                        ignoreChanges: true
                    },
                    undefined
                ],
                expectedValue: [
                    undefined,
                    '',
                    undefined
                ],
                skipAssert: true
            },
            {
                name: 'locationSpecificEnabled',
                inputValue: [undefined, true, undefined],
                expectedValue: ['false', 'true', 'false']
            },
            {
                name: 'requestSettings',
                inputValue: [
                    undefined,
                    {
                        insertXforwardedForEnabled: false,
                        insertXforwardedHostEnabled: true,
                        insertXforwardedProtoEnabled: true,
                        rewriteHeadersEnabled: false
                    },
                    undefined
                ],
                expectedValue: [
                    {
                        insertXforwardedFor: 'enabled',
                        insertXforwardedHost: 'disabled',
                        insertXforwardedProto: 'disabled',
                        rewriteHeaders: 'enabled'
                    },
                    {
                        insertXforwardedFor: 'disabled',
                        insertXforwardedHost: 'enabled',
                        insertXforwardedProto: 'enabled',
                        rewriteHeaders: 'disabled'
                    },
                    {
                        insertXforwardedFor: 'enabled',
                        insertXforwardedHost: 'disabled',
                        insertXforwardedProto: 'disabled',
                        rewriteHeaders: 'enabled'
                    }
                ]
            },
            {
                name: 'responseSettings',
                inputValue: [
                    undefined,
                    {
                        rewriteContentEnabled: false,
                        rewriteHeadersEnabled: false
                    },
                    undefined
                ],
                expectedValue: [
                    {
                        rewriteContent: 'enabled',
                        rewriteHeaders: 'enabled'
                    },
                    {
                        rewriteContent: 'disabled',
                        rewriteHeaders: 'disabled'
                    },
                    {
                        rewriteContent: 'enabled',
                        rewriteHeaders: 'enabled'
                    }
                ]
            },
            {
                name: 'rewriteList',
                inputValue: [
                    undefined,
                    ['https://www.example.com', 'https://www.rewritethis.net'],
                    undefined
                ],
                expectedValue: [
                    [],
                    ['https://www.example.com', 'https://www.rewritethis.net'],
                    []
                ]
            },
            {
                name: 'rewriteMode',
                inputValue: [
                    undefined,
                    'uri-translation',
                    undefined
                ],
                expectedValue: [
                    'portal', 'uri-translation', 'portal'
                ]
            },
            {
                name: 'setCookieRules',
                inputValue: [
                    undefined,
                    [
                        {
                            client: {
                                domain: 'clientDomain1',
                                path: '/'
                            },
                            server: {
                                domain: 'serverDomain1',
                                path: '/'
                            }
                        },
                        {
                            client: {
                                domain: 'clientDomain2',
                                path: '/'
                            },
                            server: {
                                domain: 'serverDomain2',
                                path: '/'
                            }
                        }
                    ],
                    undefined
                ],
                expectedValue: [
                    undefined,
                    [
                        {
                            name: '0',
                            client: {
                                domain: 'clientDomain1',
                                path: '/'
                            },
                            server: {
                                domain: 'serverDomain1',
                                path: '/'
                            }
                        },
                        {
                            name: '1',
                            client: {
                                domain: 'clientDomain2',
                                path: '/'
                            },
                            server: {
                                domain: 'serverDomain2',
                                path: '/'
                            }
                        }
                    ],
                    undefined
                ],
                extractFunction: (o) => {
                    if (o.setCookieRules) {
                        o.setCookieRules.forEach((rule) => {
                            delete rule.appService;
                        });
                        return o.setCookieRules;
                    }
                    return undefined;
                }
            },
            {
                name: 'splitTunnelingEnabled',
                inputValue: [
                    undefined, true, undefined
                ],
                expectedValue: [
                    'false',
                    'true',
                    'false'
                ]
            },
            {
                name: 'uriRules',
                inputValue: [
                    undefined,
                    [
                        {
                            type: 'response',
                            client: {
                                path: '/',
                                host: 'www.google.com',
                                scheme: 'https',
                                port: '100'
                            },
                            server: {
                                path: '/',
                                host: 'www.example.com',
                                scheme: 'http',
                                port: '80'
                            }
                        },
                        {
                            type: 'request',
                            client: {
                                path: '/'
                            },
                            server: {
                                path: '/'
                            }
                        }
                    ],
                    undefined
                ],
                expectedValue: [
                    [],
                    [
                        {
                            name: '0',
                            type: 'response',
                            client: {
                                path: '/',
                                host: 'www.google.com',
                                scheme: 'https',
                                port: '100'
                            },
                            server: {
                                path: '/',
                                host: 'www.example.com',
                                scheme: 'http',
                                port: '80'
                            }
                        },
                        {
                            name: '1',
                            type: 'request',
                            client: {
                                path: '/',
                                host: 'none',
                                scheme: 'none',
                                port: 'none'
                            },
                            server: {
                                path: '/',
                                host: 'none',
                                scheme: 'none',
                                port: 'none'
                            }
                        }
                    ],
                    []
                ],
                extractFunction: (o) => {
                    if (o.uriRules) {
                        o.uriRules.forEach((rule) => {
                            delete rule.fullPath;
                            delete rule.generation;
                            delete rule.kind;
                            delete rule.selfLink;
                            delete rule.appService;
                        });
                        return o.uriRules;
                    }
                    return [];
                }
            }
        ];
        return assertRewriteProfileClass(properties);
    });
});
